webpackJsonp([0x83860c60b5e7],{5696:function(e,t){e.exports={data:{post:{html:"<p>The Elbe flood seems to be weakening just a bit as it approaches Hamburg. The crest appears to have passed Magdeburg without any parts of the city going under water. Tonight the TV reports are from DÃ¶nitz and Hitzacker, on what used to be the inner-German border. The crest seems to be 50 cm lower than expected, as water has been diverted into polders upstream. The problem up north will be not so much the Elbe itself, as the Elbe dykes seem to be holding, but rather the flood backing up into its tributaries. </p>\n<p>Mama has a cousin in a flooded village in Meck-Pomm. One of her department heads still has a house in Magdeburg, which is not flooded. Another lives in Geesthacht, of which parts (including one of Mama's restaurants) will be flooded by Saturday. In our county, the dyke should hold.</p>",fields:{title:"Faster But Lower",date:"21 Aug 2002",url:"https://papascott.de/2002-08-21-faster-but-lower/"}}},pathContext:{slug:"/2002-08-21-faster-but-lower/",prev:{fields:{title:"Wedding in the Mountains",date:"20 Aug 2002",slug:"/2002-08-20-wedding-in-the-mountains/"}},next:{fields:{title:"Free WiFi In Hamburg",date:"22 Aug 2002",slug:"/2002-08-22-free-wifi-in-hamburg/"}}}}}});
